INSERT INTO `berita` VALUES ('61b2f3c44ea85', 'usr61037f9c85184', '2021-12-10', 'Situs Pemeringkat Website Alexa Ditutup Mei 2022', '&lt;p&gt;Selama ini, anak perusahaan Amazon, Alexa Internet dikenal sebagai perusahaan penyedia tools analitik dari jutaan website di dunia. Salah satunya melalui Alexa Rank, sebuah daftar peringkat popularitas situs web di dunia.&lt;/p&gt;&lt;p&gt;Daftar Alexa Rank yang bisa diakses melalui URL Alexa.com itu, kerap digunakan sebagai referensi atau insight kinerja website oleh berbagai pihak, seperti pengelola website, market, hingga media.&lt;/p&gt;&lt;p&gt;Namun, baru-baru ini, Alexa mengumumkan akan menutup situs dan layanannya pada Mei 2022 mendatang. Hal ini terungkap dalam sebuah posting di blog resmi Alexa.&lt;/p&gt;&lt;p&gt;&quot;Setelah dua dekade membantu Anda menemukan, menjangkau, dan mengonversi audiens digital Anda, kami mengambil keputusan berat untuk menghentikan Alexa.com pada 1 Mei 2022,&quot; kata Tim Alexa.com, dikutip KompasTekno, Jumat (10/12/2021).&lt;/p&gt;&lt;p&gt;Tim Alexa tidak merinci alasan penutupan situs Alexa.com tersebut. Di akhir pengumumannya, Tim Alexa hanya menyampaikan rasa terima kasih kepada pengguna setianya, karena telah menjadikan situsnya sebagai sumber daya untuk penelitian konten, analisis kompetitif, penelitian kata kunci, dan lainnya.&lt;/p&gt;&lt;p&gt;Terkait penutupan situs Alexa.com, Tim Alexa juga mengumumkan bahwa pihaknya tidak lagi menawarkan layanan berlangganan yang baru mulai 8 Desember 2021.&lt;/p&gt;&lt;p&gt;&quot;Namun, pengguna langganan yang sudah ada tetap memiliki akses ke langganannya hingga 1 Mei 2022,&quot; kata Tim Alexa.&lt;/p&gt;', 'situs-pemeringkat-website-alexa-ditutup-mei-2022', 0, 0, 0, 1, 0, 'kbrt61192748ca296', '2021-12-10 13:29:24', '2021-12-10 13:29:24');
INSERT INTO `berita` VALUES ('61b2f400d32b1', 'usr61037f9c85184', '2021-12-10', 'WhatsApp Uji Coba Fitur Pembayaran Kripto', '&lt;p&gt;REPUBLIKA.CO.ID, NEW YORK -- WhatsApp telah meluncurkan fitur baru yang memungkinkan sejumlah terbatas orang di AS mengirim dan menerima uang dari dalam obrolan menggunakan mata uang kripto. Fitur ini didukung oleh Novi, dompet digital Meta yang diluncurkan sebagai percontohan enam minggu lalu, dengan pembayaran yang dilakukan menggunakan Pax Dollars (USDP), sebuah stablecoin yang dipatok ke dolar AS yang dikeluarkan oleh Paxos.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Berita itu diumumkan oleh kepala mendatang Novi, Stephane Kasriel dan Will Cathcart dari WhatsApp, dilansir di The Verge, Kamis (9/12). Menurut situs web Novi, mengirim pembayaran berfungsi seperti mengirim lampiran lain di WhatsApp. Anda mengakses fitur tersebut melalui ikon klip kertas di Android atau ikon + di iOS, lalu pilih “Pembayaran” dari menu yang muncul.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Situs Novi mencatat tidak ada biaya untuk mengirim atau menerima uang, tidak ada batasan seberapa sering pembayaran dapat dikirim, dan tidak ada biaya untuk menyimpan saldo di akun Novi Anda atau untuk menariknya ke rekening bank Anda. Pembayaran ditransfer secara instan.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&quot;Ada cara baru untuk mencoba dompet digital @Novi. Mulai hari ini, sejumlah terbatas orang di AS akan dapat mengirim dan menerima uang menggunakan Novi di @WhatsApp, membuat pengiriman uang ke keluarga dan teman semudah mengirim pesan,&quot; ujar Stephane Kasriel (@skasriel) di Twitter, Rabu (8/12).&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Fitur pilot Novi awalnya tersedia di AS dan Guatemala, tetapi WABetaInfo mencatat bahwa pengguna di Guatemala tidak akan dapat mengakses fungsi pembayaran WhatsApp yang baru. Sebagai gantinya, mereka harus terus menggunakan aplikasi Novi mandiri.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Pembayaran tidak memengaruhi enkripsi end-to-end WhatsApp, yang diterapkan secara default untuk semua percakapan pribadi. Pilot WhatsApp Novi tersedia dalam bahasa Inggris dan Spanyol.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Percontohan baru ini berakar pada rencana kripto Facebook (sekarang Meta), yang secara resmi diumumkan pada tahun 2019. Pada saat itu, Facebook (sebagai bagian dari Asosiasi Libra) berencana untuk mengembangkan dan meluncurkan kripto yang disebut Libra, yang akan dipatok ke sekeranjang aset volatilitas rendah daripada satu mata uang tertentu.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Ini akan terintegrasi dengan dompet digital yang dikembangkan Facebook yang disebut Calibra. Seluruh sistem dirancang untuk menawarkan cara mengirim uang ke seluruh dunia dengan biaya lebih rendah daripada metode tradisional.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Rencana-rencana ini telah banyak berubah sejak saat itu. Libra telah menjadi Diem, Asosiasi Libra telah kehilangan beberapa anggotanya yang paling terkenal dan menjadi Asosiasi Diem, dan Calibra telah menjadi Novi. Mungkin yang paling menonjol, Novi akhirnya diluncurkan tanpa kripto Diem.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sebaliknya, Pax Dollars adalah karya dari perusahaan terpisah bernama Paxos, dan Meta mengandalkan pertukaran kripto Coinbase sebagai mitra penjagaannya.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Kepala Novi saat itu David Marcus mengatakan bahwa perusahaan masih berkomitmen untuk Diem ketika dia mengumumkan peluncuran pilot Novi pada Oktober.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&quot;Kami bermaksud meluncurkan Novi dengan Diem setelah menerima persetujuan regulator,&quot; cuit Marcus.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;David Marcus kemudian mengatakan dia akan meninggalkan perusahaan pada akhir tahun. Dia menyebut pilot Novi di WhatsApp sebagai &quot;hadiah perpisahan terbaik dari tim terbaik yang pernah ada!&quot;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sementara rencana pembayaran WhatsApp AS berkisar pada Novi dan kripto, di tempat lain di dunia itu sudah menawarkan pembayaran menggunakan mata uang fiat tradisional. Fitur ini mendapat peluncuran luas di India tahun lalu, dan juga telah diluncurkan di Brasil.&lt;/p&gt;', 'whatsapp-uji-coba-fitur-pembayaran-kripto', 1, 0, 0, 7, 0, 'kbrt61192748ca296', '2021-12-10 13:30:24', '2021-12-10 13:30:24');
INSERT INTO `berita` VALUES ('61b2f441af9f6', 'usr61037f9c85184', '2021-12-10', 'Jelang Debut Pekan Depan, Oppo Mulai Ungkap Tampilan HP Layar Lipat, Begini', '&lt;p&gt;jpnn.com - Oppo akhirnya mengumumkan bahwa handphone (HP) lipat yang diberi nama Find N itu meluncur pada 15 Desember 2021.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Namun, menjelang debutnya resminya berbagai bocoran pun mulai bermunculan.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Terbaru mengenai desain yang akan dibawa oleh ponsel asal Tiongkok tersebut.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Dari video yang beredar, desain ponsel lipat itu terlihat mirip dengan Galaxy Z Fold 3.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sebab, saat ditutup tidak memiliki celah di antara panel.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Dikutip GSM Arena, JUmat (9/12), hanya saja perusahaan belum memberikan secara memerinci mengenai spesifikasi HP lipat itu.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Namun berdasarkan informasi dari leaker kenaman Digital Chat Station, HP layar lipat itu akan hadir dengan layar LTPO berukuran 7,8 inci hingga 8 inci dengan refresh rate 120 Hz.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;HP layar lipat itu diharapkan memiliki tiga kamera di bagian belakang.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Ponsel tersebut akan ditenagai oleh Snapdragon 888 yang dipadu RAM 12GB.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Bocoran mengungkapkan bahwa ponsel itu dijalankan sistem operasi Android 11, tetapi akan mendapatkan pembaruan untuk Android 12 akan segera hadir setelah peluncuran nanti&lt;/p&gt;', 'jelang-debut-pekan-depan-oppo-mulai-ungkap-tampilan-hp-layar-lipat-begini', 0, 1, 0, 0, 0, 'kbrt61192748ca296', '2021-12-10 13:31:29', '2021-12-10 13:31:29');
INSERT INTO `berita` VALUES ('61b2f4cbbbaa5', 'usr61037f9c85184', '2021-12-10', 'Yamaha Siap Luncurkan Motor Sport Baru, Cocok Buat Orang Kaya', '&lt;p&gt;Demi merangkul orang kaya pecinta motor sport di dunia, Yamaha sedang mempersiapkan produk terbarunya. Namun hingga kini belum diketahui tioe yang dimaksud, meskipun sudah ramah menjadi bahan perbincangan.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Melansir Motorcycle.com, dan Greatbiker.com, sebelumnya pabrikan asal Jepang itu diam-diam sudah mendaftarkan nama motor sport baraunya, Yamaha R7 dalam registrasi uji emisi di California Air Resources Board atau CARB.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Namun hingga kini tidak ada lagi kabar terkait R7, bahkan muncul nama baru dari pabrikan motor berlogo garpu tala tersebut, yaitu YZF-R9 sejak Maret 2021. Kini kabar terbarunya, produk tersebut akan meluncur dalam waktu dekat.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Melalui channel Youtube Mich Superbike, rendering R9 ditampilkan dalam desain futuristis. Fairingnya tampak minimalis karena tidak menutupi seluruh mesin besarnya, dengan menonjolkan sasis delta box yang kokoh mengkotak.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Bagian tameng, serta windscreen depan menonjolkan ciri khas R series terbaru, dipadukan head lamp atau lampu utama yang sipit. Struktur tangki memainkan banyak lekukan, mengalir sampai jok dan bodi belakang dengan garis tajam.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Pada sektor kaki-kaki, suspensi depan upside down dibalut warna emas pada tabung atas, dengan spakboard hitam berbahan karbon. Pengereman depan double disk brake didukung kaliper besar yang membuat sektor depan tampak gemuk.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Namun rendering yang ditampilkan dalam video Youtube tersebut tidak ada keterangan resmi dari Yamaha, sehingga hanya sekadar dugaan bahwa wujud Yamaha R9 yang kabarnya meluncur pada 2022.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Melalui Greatbikers, mesin yang bersarang di moge baru Yamaha itu diduga memiliki kapasitas mesin 889cc milik MT-09 tiga silinder. Dapat menyemburkan tenaga maksimal 119 PS dan torsi 93 Nm di putaran mesin 7.000 rpm.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Fitur-fitur didalamnya tentu akan mengikuti kebutuhan, dan spesifikasi mesin nantinya. Namun diharapkan sudah memiliki quick shifter, sistem slipper clutch, kontrol traksi, hingga pengereman ABS (anti-lock braking system).&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Belum ada informasi terkait waktu tepat peluncuran Yamaha R19 pada tahun depan, begitu juga negara pertama yang akan menjualnya. Tunggu saja!&lt;/p&gt;', 'yamaha-siap-luncurkan-motor-sport-baru-cocok-buat-orang-kaya', 0, 0, 0, 0, 0, 'kbrt61390424c284e', '2021-12-10 13:33:47', '2021-12-10 13:33:47');
INSERT INTO `berita` VALUES ('61b2f517eb401', 'usr61037f9c85184', '2021-12-10', 'Terkenal di TV, Modifikator Amerika Bikin Mobil Pakai Produk Indonesia', '&lt;p&gt;Berbagai cara dilakukan pecinta modifikasi mobil agar tampil maksimal. Umumnya komponen atau aksesroi yang digunakan adalah buatan luar negeri, terutama brand ternama yang sudah terkenal di kalangan modifikator.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Padahal Indonesia juga membuat sejumlah part aftermarket yang udah diakui dunia. Ada beberapa produk yang sudah ekspor ke beberapa negara, yang digunakan modifikator luar negeri untuk menunjang penampilan.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Seperti yang dilakukan bengkel modifikasi West Customs asal Burbank, California, Amerika Serikat yang memanfaatkan pelek buatan anak bangsa, yakni DNZ Wheels. Diterapkan pada mobil lawas garapannya, yaitu Honda Civic Nouva.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Pelek dengan kelir merah metalik tersebut berukuran 16 inci Type One dengan PCD atau lubang baut 4 per 100, danET 38.Dikombinasikan dengan bodykit Project J yang juga garapan orang RI berlabur putih dengan aksesn garis hitam.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Mobil hatchback lansiran 1988 tersebut terlihat lebih eye cathing, dan sporty berkat bodi kit yang meliputi lips on depan, bumper depan, wide bodi fender, side skirts, dan bumper belakang yang dikirim langsung dari Tanah Air.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Proses modifikasi Civic Nouva itu didatangkan dalam kondisi tidak terawat. Sehingga mendapatkan ubahan desain, serta melakukan proses restorasi ke seluruh bagian mobil yang meliputi eksterior, interior, dan kaki-kaki.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Bahkan dapur pacunya diganti alias swap engine, dengan penggunakan transmisi manual baru 5-percepatan. Dalam pengerjaannya, dikawal langsung oleh Ryan Friedlinghaus punggawa dari&amp;nbsp; West Coast Customs.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Diketahui, Ryan terkenal melalui program acara modifikasi MTV ‘Pimp My Ride’, di mana acara itu menampilkan sebuah mobil milik seseorang yang disulap menjadi bagus dari keadaan rongsok hingga pemiliknya terkejut.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Sementara Head Designer West Coast Customs, Musa Tjahjono mengatakan, bahwa mobil tersebut di bawa ke bengkel dalam keadaan yang tidak baik. Banyak perubahan yang dilakukan, selain menyematkan parts aftermarket.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;“Kami mencoba memberikan yang terbaik seperti yang biasa kami lakukan di sini. Tentu produk Indonesia, DNZ Wheels, dan Bodykit Project J menu utama yang ingin kami sematkan, dan harus kami akui kualitas produk Indonesia ini sudah memiliki kelas dunia,” ujarnya mengutip dari keterangan resminya, Jumat 10 Desember 2021.&lt;/p&gt;', 'terkenal-di-tv-modifikator-amerika-bikin-mobil-pakai-produk-indonesia', 0, 0, 0, 1, 0, 'kbrt61390424c284e', '2021-12-10 13:35:03', '2021-12-10 13:35:03');
INSERT INTO `berita` VALUES ('61b2f5502d02e', 'usr61037f9c85184', '2021-12-10', 'Rumor Kawasaki Bangkitkan Eliminator 250, Pakai Mesin ZX-25R', '&lt;p&gt;Sebelumnya, Kawasaki dikabarkan akan mengembangkan Z250RS 4-silinder. Belum lama ini, pabrikan Jepang tersebut dikabarkan akan menghidupkan kembali model legendaris, yakni Eliminator 250. Konsep motornya pun sudah dibuat secara digital oleh Shinji Miyakubo.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Untuk diketahui, Eliminator pertama kali diluncurkan pada 1985 lalu. Motor bergaya cruiser tersebut awalnya menggunakan mesin yang sama seperti GPZ, yakni berkapasitas 900 cc dan 750 cc, 4-silinder segaris.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Pada 1986, Kawasaki menghadirkan Eliminator 400. Tak berhenti sampai di situ, Kawasaki juga meluncurkan Eliminator 250 pada 1987.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Namun, untuk Eliminator 250 mengandalkan mesin 2-silinder segaris, seperti yang digunakan GPZ250R. Pada masanya, motor tersebut yang paling bertenaga dibanding kompetitor sekelasnya.&lt;/p&gt;', 'rumor-kawasaki-bangkitkan-eliminator-250-pakai-mesin-zx-25r', 0, 0, 0, 0, 0, 'kbrt61390424c284e', '2021-12-10 13:36:00', '2021-12-10 13:36:00');
