INSERT INTO `profil` VALUES ('usr61037f9c85184', 'Panca Teknologi Aksesindo', 'System Integrator', '<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>', '<h3 style=\"font-family: Roboto, sans-serif; color: rgb(38, 47, 51); letter-spacing: 0.4px; text-align: center;\">VISI</h3><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Dalam rangka melaksanakan agenda pembangunan RPJMN 2020-2024 dan menjalankan amanah sesuai tugas dan fungsinya, pada tahun 2020-2024 Badan Riset dan Inovasi Nasional menetapkan visi sebagai berikut:</p><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\"><span style=\"font-weight: bolder;\">“Badan Riset dan Inovasi Nasional yang andal, professional, inovatif dan berintegritas dalam pelayanan kepada Presiden dan Wakil Presiden untuk mewujudkan Visi dan Misi Presiden dan Wakil Presiden : Indonesia Maju yang Berdaulat, Mandiri, dan Berkepribadian berlandaskan Gotong Royong”</span></p><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Kemampuan invensi dan inovasi dimaksudkan untuk menghasilkan produk hasil riset yang dilaksanakan dan inovasi yang berpotensi , sedangkan kemampuan iptek dan inovasi dimaknai sebagai keahlian SDM dan lembaga litbang serta perguruan tinggi dalam melaksanakan kegiatan penelitian, pengembangan, pengkajian dan penerapan iptek yang ditunjang oleh pembangunan faktor input (kelembagaan, sumber daya, dan jaringan).</p><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Sementara itu, makna daya saing bangsa adalah kontribusi iptek dan pendidikan tinggi dalam perekonomian yang ditunjukkan oleh keunggulan produk teknologi hasil litbang yang dihasilkan oleh industri/perusahaan yang didukung oleh lembaga litbang (LPNK, LPK, Badan Usaha, dan Perguruan Tinggi) dan SDM yang berkarakter unggul dan berwawasan kebangsaan.</p><h3 style=\"font-family: Roboto, sans-serif; color: rgb(38, 47, 51); letter-spacing: 0.4px; text-align: center;\">MISI</h3><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Sebagai upaya untuk mewujudkan visi tersebut di atas, misi Badan Riset dan Inovasi Nasional adalah:</p><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Badan Riset dan Inovasi Nasional melaksanakan Misi Presiden dan Wakil Presiden :</p><ol style=\"color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px;\"><li>Peningkatan Kualitas Manusia Indonesia,</li><li>Peningkatan Struktur Ekonomi yang Produktif, Mandiri, dan Berdaya Saing,</li><li>Pembangunan yang Merata dan Berkeadilan,</li><li>Mencapai Lingkungan Hidup yang Berkelanjutan,</li><li>Kemajuan Budaya yang Mencerminkan Kepribadian Bangsa, dan</li><li>Pengelolaan Pemerintahan yang Bersih, Efektif, dan Terpercaya,</li></ol><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px;\">dengan uraian sebagai berikut:</p><ol style=\"color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px;\"><li style=\"text-align: justify;\">Peningkatan Kapabilitas IPTEK, Budaya Riset, dan Penciptaan Inovasi melalui peningkatan Kualitas SDM IPTEK, Penguatan Transformasi Ekonomi, dan Pembangunan Berkelanjutan berlandaskan Budaya Iptek untuk Peningkatan Daya Saing.</li><li style=\"text-align: justify;\">Peningkatan Pengelolaan Pemerintahan yang Bersih, Efektif, dan Terpercaya</li></ol><p style=\"margin-bottom: 16px; color: rgb(38, 47, 51); font-family: Roboto, sans-serif; letter-spacing: 0.4px; text-align: justify;\">Misi ini mencakup upaya menjawab permasalahan pembangunan iptek dan pada periode 2020-2024 dalam aspek kebijakan riset dan inovasi, kerjasama pembangunan dan kemitraan, peningkatan penelitian, pengembangan, pengkajian dan penerapan Iptek pada beberapa fokus prioritas riset dan inovasi nasional, serta peningkatan tata kelola pemerintaha yang baik dalam rangka reformasi birokrasi.</p>', '2021-12-04 15:34:35', '2021-12-04 15:34:35');
INSERT INTO `profile_team` VALUES ('61bff364614d5', 'Hellen Watson', '1273817', 'hellen@mail.com', 'Bandung', '2021-12-20', '2021-12-20', '2', '1', 'Jl. Kangkun No. 18 RT.01/RW.06', 'Currently the Independent President Commissioner of the Company based on the Company’s Deed no. 120, dated 27th August 2020. Sri Indrastuti Hadiputranto is concurrently an Independent Commissioner of PT Astra International Tbk since January 2018. She is also a Senior Advisor of PT Morgan Stanley Indonesia since January 2017, as well as a member of Risk Oversight Committee of PT CIMB Niaga Tbk since July 2016. She was the Founding Partner of the law firm Hadiputranto, Hadinoto & Partners (1989- 2016), and an International Partner of Baker & McKenzie (retired).', 'Previously, she was a member of the Board of Commissioners of the Indonesia Stock Exchange (2001-2004) and a member of the Committee of Broker Disciplinary, Indonesia Stock Exchange (2009-2013).', '2021-12-20 10:07:16', '2021-12-20 10:07:16');
INSERT INTO `profile_team` VALUES ('61c1465673476', 'Jimmy Hart', '098293748', 'jimmy@mail.com', 'Berlin', '1994-12-21', NULL, '1', '1', NULL, 'GBPH H. Prabukusumo, S. Psi currently serves as the Independent Vice President Commissioner of the Company. His appointment is based on the Company’s Deed no.120, dated 27th August 2020. Previously, he served as a Commissioner as well as Independent Commissioner of the Company, based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 10 dated 26 June 2009.', 'Concurrently, he is also the President Commissioner of PT Jogjakarta Tugu Televisi (since 2003), Commissioner of BPR Mataram Manunggal in Yogyakarta, President Director of PT Karka Abisatya Mataram (since 1993) and the Commissioner of PT Lintas Indo Cakrawala (since 2010).', '2021-12-21 10:13:26', '2021-12-21 10:13:26');
INSERT INTO `profile_team` VALUES ('61c146b2148d5', 'Robert Ash', '0897237487', 'robert@mail.com', 'Berlin', '1991-12-22', NULL, '1', '2', NULL, 'Michael David Capper joined the Company in 2002 and has been a Company Director since 2010. His current appointment is based on the Company’s Deed no.120, dated 27th August 2020. Prior to that, he served as an Independent Director from 2005 to 2006 based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 18, dated 23 June 2005. He also served as an Independent Director from 2007 to June 2010 based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 37 dated 22 June 2007.', 'A British citizen born in 1964, Michael David Capper is a former international athlete for Great Britain, a past winner of the Hong Kong Marathon, and the current double World Masters Games Champion at 5km & 10km. He earned his Bachelor of Arts degree in English Language & Literature from Providence College, Rhode Island, USA in 1986.', '2021-12-21 10:14:58', '2021-12-21 10:14:58');
INSERT INTO `profile_team` VALUES ('61c152e802bbe', 'Wlilly Smith', '085132932849', 'will@mail.com', 'Ascent', '1993-12-21', NULL, '1', '2', NULL, 'andaka Santosa was appointed as a Director of the Company, based on the Company’s Deed no. 120, dated 27th August 2020. Prior to that, he was the Commissioner of the Company appointed in 2014, based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 15, dated 21 May 2014. Before his appointment as a member of the Board, Handaka Santosa was the CEO of Senayan City between 2005 to 2014, Vice President Director of PT Agung Podomoro Land Tbk from 2010 to 2013, and also an Independent Commissioner of Alfa Retailindo from 2008 to 2011. Currently he serves as a member of the top management team at SOGO Indonesia, as the President Commissioner of PT Map Boga Adiperkasa Tbk and as a Commissioner of PT Map Aktif Adiperkasa Tbk. He was also a former Commissioner of the MAP Group up to 2005 and a Director of Gajah Mada Plaza between 1981 and 1988.', 'Besides his role in the Company, he holds numerous key positions in several leading organizations, including Head of Committee of Property Services Development for Indonesian Chamber of Commerce & Industry (2015 – 2020), Chairman of Indonesia Shopping Centres Management Association (2012 – 2015), Advisor to Indonesia Retail Merchants Association (2011 – 2015), Executive member of the National Consumer Protection Agency (2009 – 2012), General Secretary and Chairman of the Association of Indonesian Retailers (2000 – 2008), and many other organizations.', '2021-12-21 11:07:04', '2021-12-21 11:07:04');
INSERT INTO `profile_team` VALUES ('61c155f2d2e82', 'Casey Rose', '087237798238', 'casey@mail.com', 'Bind', '1992-12-15', NULL, '2', '3', 'Bind', 'With years of experience spearheading the Company’s financial strategies and policies, Susiana Latif is currently one of the Directors of the Company. Her current appointment is based on the Company’s Deed no.120, dated 27th August 2020. Concurrently, she serves as a Commissioner of PT Map Aktif Adiperkasa Tbk since 2018.', 'She first joined MAP in 1995 overseeing all financial aspects of the Company. Having spent over 25 years providing financial leadership at MAP, she is a vital member of the Company.', '2021-12-21 11:20:02', '2021-12-21 11:20:02');
INSERT INTO `profile_team` VALUES ('61c15641bdc07', 'Ramsey Owen', '089777767', 'ramsey@mail.com', 'Haven', '1893-12-24', NULL, '1', '3', NULL, 'A member of the Board since 2010, Hendry Hasiholan Batubara served as an Independent Director of the Company from June 2010 to June 2011, appointed based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 62 dated 16 June 2010. Following that, he serves as a Director of the Company based on the Minutes of Meeting of the Annual General Meeting of Shareholders No. 2 dated 10 June 2011. Currently he is a Commissioner of the Company, appointed based on the Company’s Deed no.120, dated 27th August 2020.', 'An Indonesian citizen born in 1957, Hendry Hasiholan Batubara is also concurrently the President Director of PT Sumarco Makmun Indah. Hendry Hasiholan Batubara obtained his Bachelor’s Degree in Social and Politics from University of Indonesia, in 1982.', '2021-12-21 11:21:21', '2021-12-21 11:21:21');
